.form__div{
  position: relative;
  height: 40px;
}
.form__input{
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  font-size: 15px;
  border: 1px solid #bdbdbd;
  border-radius: .5rem;
  outline: none;
  padding-left: 1rem;
  background: none;
  z-index: 1;
}
.form__label{
  position: absolute;
  left: 1rem;
  top: 50%;
  transform: translateY(-50%);
  padding: 0 .25rem;
  background-color: #fff;
  color: #9f9d9d;
  font-size: var(--normal-font-size);
  transition: .3s;
}

